class UserService{

    constructor(httpClient){
        this.httpClient = httpClient;
    }

    async getUsers(user_id){
        try{
            const response = await this.httpClient.get('http://localhost:8000/users/user' + user_id );
            return response.json();
        } catch (error){
            console.error(error);
            throw error;
        }
    }

    async createUsers(user){
        try{
            const response = await this.httpClient.post('http://localhost:8000/users', user);
            return response.json();
        } catch (error){
            console.error(error);
            throw error;
        }
    }

}

export default UserService
